// src/pages/NovoAdmin.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

const NovoAdmin = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    email: '',
    senha: '',
    nivelAcesso: '',
  });
  const [erros, setErros] = useState({});

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setErros({});
    try {
      await api.post('/admins', form);
      navigate('/admins');
    } catch (err) {
      if (err.response?.data?.errors) {
        const formatted = {};
        err.response.data.errors.forEach((erro) => {
          formatted[erro.param] = erro.msg;
        });
        setErros(formatted);
      } else {
        console.error('Erro ao salvar admin:', err);
      }
    }
  };

  return (
    <div className="container my-5">
      <div className="p-4 border rounded shadow-sm bg-white">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2>Novo Admin</h2>
          <div>
            <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/admins" className="btn btn-dark">Ver Admins</Link>
          </div>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Nome</label>
            <input
              type="text"
              className={`form-control ${erros.nome ? 'is-invalid' : ''}`}
              name="nome"
              value={form.nome}
              onChange={handleChange}
              required
            />
            {erros.nome && <div className="invalid-feedback">{erros.nome}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Email</label>
            <input
              type="email"
              className={`form-control ${erros.email ? 'is-invalid' : ''}`}
              name="email"
              value={form.email}
              onChange={handleChange}
              required
            />
            {erros.email && <div className="invalid-feedback">{erros.email}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Senha</label>
            <input
              type="password"
              className={`form-control ${erros.senha ? 'is-invalid' : ''}`}
              name="senha"
              value={form.senha}
              onChange={handleChange}
              required
            />
            {erros.senha && <div className="invalid-feedback">{erros.senha}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Nível de Acesso</label>
            <select
              className={`form-select ${erros.nivelAcesso ? 'is-invalid' : ''}`}
              name="nivelAcesso"
              value={form.nivelAcesso}
              onChange={handleChange}
              required
            >
              <option value="">Selecione</option>
              <option value="super">Super</option>
              <option value="admin">Admin</option>
              <option value="moderador">Moderador</option>
            </select>
            {erros.nivelAcesso && <div className="invalid-feedback">{erros.nivelAcesso}</div>}
          </div>

          <button type="submit" className="btn btn-success">Salvar</button>
        </form>
      </div>
    </div>
  );
};

export default NovoAdmin;
